/*
	FORMAT AUTONUMERIC
*/
	Handlebars.registerHelper
	(
		"formatAutoNumeric2",
		function(v,ref,options) 
		{	
			if ( typeof(v) === "number" && isNaN(v) )
			{
				v="0";
			}

			if  ( typeof(v) === "string" )
			{
				t = v;
				v = {};
				v["__text"] = ""+t+"";
			}

			if  ( typeof(v) === "number" )
			{
				t = v;
				v = {};
				v["__text"] = ""+t+"";
			}

			if ( typeof (v) === "undefined" )
			{
				v = {};
			}

			if ( typeof (v.__text) === "undefined" )
			{
				return "/";
			}

			if ( v.__text.endsWith(".00") )
			{
				v.__text = v.__text.substr( 0 , v.__text.length-3 );
			}

			if ( v.__text.endsWith(".00000000") )
			{
				v.__text = v.__text.substr( 0 , v.__text.length-9 );
			}

			if ( ref !== "" )
			{
				ref_obj	= RHEA.jsonData.project.config.refs.ref.find( function(o) { if (o._ref === ref) return o; } ).data;
				options = RHEA.behaviours["AUTONUMERIC"].build_option(ref_obj);
			}
			else
			{
				options = $.extend( {}, RHEA.behaviours["AUTONUMERIC"].options );

				options.allowDecimalPadding = true;
				options.decimalPlacesOverride= 2;
			}

            try
            {
			     v = window.autonumeric.default.format( v.__text , options );
            }
            catch(e)
            {
                    v = "";
            }

			return ""+v+"";
		}
	);	
/*
	EACH2
*/
	Handlebars.registerHelper
	(
		'each2', 
		function(context , attr, value, options) 
		{
  			var ret = "";

  			for(var i=0, j=context.length; i<j; i++) 
  			{
  				if ( context[i][""+attr+""] === value )
  				{
  					context[i]._index = i;
    				ret = ret + options.fn(context[i]);
    			}
  			}

  			return ret;
		}
	);		
